import * as React from 'react';
import TextField from '@mui/material/TextField';
import { Box } from '@mui/material';
import Autocomplete from '@mui/material/Autocomplete';
import '../Styles/style.css'

//Return name of the currencies
function convertCurrencyAbbreviations(input) {
    const currencyMappings = {
        SGD: "Singapore Dollar",
        MYR: "Malaysian Ringgit",
        EUR: "Euro",
        USD: "US Dollar",
        AUD: "Australian Dollar",
        JPY: "Japanese Yen",
        CNH: "Chinese Yuan",
        HKD: "Hong Kong Dollar",
        CAD: "Canadian Dollar",
        INR: "Indian Rupee",
        DKK: "Danish Krone",
        GBP: "British Pound",
        RUB: "Russian Ruble",
        NZD: "New Zealand Dollar",
        MXN: "Mexican Peso",
        IDR: "Indonesian Rupiah",
        TWD: "Taiwan Dollar",
        THB: "Thai Baht",
        VND: "Vietnamese Dong"
    };

    const abbreviations = Object.keys(currencyMappings);
    const regex = new RegExp(abbreviations.join("|"), "gi");

    return input.replace(regex, match => currencyMappings[match.toUpperCase()] || match);
}

export default function FromCurrencyTextField(props) {

    // return (
    //     <TextField
    //         id='textField1' variant="outlined" fullWidth value={convertCurrencyAbbreviations(props.data)}
    //         autoComplete='ABC'
    //     />
    // )

    return (
        <Autocomplete
            fullWidth
            className="country-select-demo"
            sx={{ width: 300 }}
            options={countries}
            autoHighlight
            getOptionLabel={(option) => option.label}
            renderOption={(props, option) => (
                <Box
                    component="li"
                    sx={{ '& > img': { mr: 2, flexShrink: 0 } }}
                    {...props}
                >
                    <img
                        loading="lazy"
                        width="20"
                        src={`https://flagcdn.com/w20/${option.code.toLowerCase()}.png`}
                        srcSet={`https://flagcdn.com/w40/${option.code.toLowerCase()}.png 2x`}
                        alt=""
                    />
                    {option.label} ({option.code})
                </Box>
            )}
            renderInput={(params) => (
                <TextField
                    {...params}
                    inputProps={{
                        ...params.inputProps,
                        autoComplete: 'new-password', // disable autocomplete and autofill
                    }}
                />
            )}
        />
    );

}

